svg.script:
 var memoji = {
	tip : null,r : null,t : null,c : null,
	checkTypeOfMember : function(o,m) {try {return typeof(o[m])!='undefined';}catch(ex) {return false;}},
	callWindowParentFunction1 : function(m,a1) {if(memoji.checkTypeOfMember(window.parent, m)) window.parent[m](a1);},
	selectR : function(r) {
		if (memoji.c!=null) memoji.c.setAttribute('class','emoji');
		memoji.c=r;memoji.c.setAttribute('class','emojiS');
	},
	select : function(id) {
		var e = document.getElementById(id);
		if (e!=null) memoji.selectR(e.firstChild.nextSibling);
	},
	onEmojDown : function(evt) {
		try {
		memoji.selectR(evt.target);
		memoji.callWindowParentFunction1('onStartEmojTaskTool',evt.target.previousSibling);
		} catch(ex) {alert("onEmojDown "+ex);}
	},
	onEmojOver : function(evt,code,dx,dy) {
		var tr = evt.target.parentNode.getAttribute("transform");
		if (memoji.tip==null) {memoji.tip = document.getElementById("emoj-tip");memoji.r = memoji.tip.firstChild;memoji.t = memoji.tip.lastChild;}
		memoji.tip.setAttribute("transform",tr+ " translate("+dx+" "+dy+")");memoji.tip.setAttribute("visibility","visible");memoji.t.firstChild.data=code;
		var b = memoji.t.getBBox();
		memoji.r.x.baseVal.value=b.x-1;memoji.r.y.baseVal.value=b.y-1;memoji.r.width.baseVal.value=b.width+2;memoji.r.height.baseVal.value=b.height+2;
	},
	onEmojOut : function(evt) {if (memoji.tip!=null) memoji.tip.setAttribute("visibility","hidden");}	
 };
 window['memoji_select']=memoji.select;
 window['memoji_onEmojDown']=memoji.onEmojDown;
 window['memoji_onEmojOver']=memoji.onEmojOver;
 window['memoji_onEmojOut']=memoji.onEmojOut;
 try {
 window.parent['memoji_select'] = memoji.select ;
} catch (e) {
};
